import React, { useEffect } from "react";
import Navbar from "../../components/Navbar";
// formik
import { Formik, Field, Form } from "formik";

function Login() {
  useEffect(() => {
    document.title = "Admin | Login";
  });

  return (
    <div className="min-h-screen max-w-2xl mx-auto font-inter">
      <Navbar />
      <div className="px-6 py-12 mt-16">
        <Formik
          initialValues={{ name: "", email: "" }}
          onSubmit={async (values) => {
            await new Promise((resolve) => setTimeout(resolve, 500));
            alert(JSON.stringify(values, null, 2));
          }}
        >
          <Form className="flex flex-col space-y-4 max-w-[400px] mx-auto p-4 bg-gray-100 dark:bg-black dark:border-[1px] dark:border-gray-700 rounded-xl">
            <div className="w-full">
              <label className="mb-3 block text-base font-medium text-[#07074D]" htmlFor="username">Username</label>
              <Field
                name="name"
                type="text"
                className="w-full px-3 py-2 outline-none rounded"
                autoComplete="off"
                id="username"
              />
            </div>
            <div className="w-full">
              <label className="mb-3 block text-base font-medium text-[#07074D]" htmlFor="password">Password</label>
              <Field
                name="password"
                type="password"
                className="w-full px-3 py-2 outline-none rounded"
                autoComplete="off"
                id="password"
              />
            </div>
            <div className="w-full flex justify-end">
              <button
                type="submit"
                className="px-4 py-2 text-black dark:text-white border rounded bg-gray-300"
              >
                Submit
              </button>
            </div>
          </Form>
        </Formik>
      </div>
    </div>
  );
}

export default Login;
